    Graficas1Component.prototype.cargarGraficoUno = function (id, tipo) {
        var _this = this;
        this._graficoService.obtenerGrafico(id, tipo)
            .subscribe(function (grafico) {
            var data1 = +grafico[0].data;
            var data2 = +grafico[1].data;
            var data3 = +grafico[2].data;
            var grafico_id = grafico[0]._id;
            data1 = Number(data1.toFixed(2));
            data2 = Number(data2.toFixed(2));
            data3 = Number(data3.toFixed(2));
            _this.dataG1 = [data1, data2, data3];
            _this.graficos.grafico1.datasets[0].data = _this.dataG1;
            var monthNames = ["Enero", "Febrero", "Marzo", "Abril", "Mayo", "Junio",
                "Julio", "Agosto", "Septiembre", "Octubre", "Noviembre", "Diciembre"
            ];
            var mes1 = monthNames[+grafico[0].mes - 1];
            var mes2 = monthNames[+grafico[0].mes - 2];
            var mes3 = monthNames[+grafico[0].mes - 3];
            _this.graficos.grafico1.labels = [mes1, mes2, mes3];
            _this.idG1 = grafico_id;
        });
    };
